『ヒロインメイク ロングカール ウォータープルーフ 01漆黒ブラック』<br><br>■【商品詳細】<br>・5mmのロングエクステファイバー配合、重ねるほどに長く伸び、毛先まで均一なダマのない美ロングまつ毛に仕上げるマスカラです。<br>・瞬間ロック成分・形状記憶ポリマー配合、くるんと上向きカールが長時間持続します。<br>・涙・汗・水・皮脂・こすれに特に強い、スーパーウォータープルーフタイプ。<br>・まつ毛美容液成分配合。ツバキオイル・ローヤルゼリーエキス・アルガンオイル・野バラオイル(カニナバラ果実油／まつ毛保護成分)<br>・繊維入りでダマなしロング。<br>・目の形に沿って根元からまつ毛を持ち上げるカーブブラシ<br>※落とすときはヒロインメイクシリーズのリムーバーをご使用いただくと、きれいに落とせます。または油性クレンジング料をお使いください。<br><br>■【使用方法】<br>(1)ブラシの内側でまつ毛の根元から毛先までまっすぐ塗布します。「スッ、スッ」と毛先までまっすぐに塗ると美しいまつ毛に仕上がります。<br>(2)ブラシの外側で目頭や目尻などの細かい部分を仕上げます。<br>※ブラシをジグザグに動かさないことがポイント！<br>※より美しく仕上げるために、中身をブラシでよくかきまぜてから使用されることをおすすめします。<br><br>■【成分】<br>イソドデカン、トリメチルシロキシケイ酸、ジステアルジモニウムヘクトライト、マイクロクリスタリンワックス、セレシン、(パルミチン酸／エチルヘキサン酸)デキストリン、炭酸プロピレン、水添ポリイソブテン、ナイロン-66、アルガニアスピノサ核油、ツバキ種子油、カニナバラ果実油、スクワラン、ローヤルゼリーエキス、PTFE、ジステアリン酸AL、イソステアリン酸グリセリル、ポリメチルシルセスキオキサン、(メタクリル酸ジエチルアミノエチル／HEMA／メタクリル酸パーフルオロヘキシルエチル)クロスポリマー、シリカ、タルク、酸化鉄、酸化チタン<br><br>■【注意事項】<br>・傷、はれもの、湿疹等、異常のあるときは、ご使用をおやめください。<br>・使用中、又は使用後日光にあたって、赤味、はれ、かゆみ、刺激等の異常があらわれたときは、使用を中止し、皮フ科専門医等へご相談をおすすめします。そのまま他の化粧品も含めて使用を続けますと、悪化することがあります。<br>・目に入ったときは、こすらず、すぐに水かぬるま湯で洗い流してください。異物感が残る場合は眼科医へご相談をおすすめします。<br>・使用後は、容器の口元をきれいにふきとり、しっかりキャップを閉めてください。<br>・極端に高温又は低温の場所、直射日光のあたるところには置かないでください。<br><br><br>広告文責：株式会社ドラッグピュア<br>作成：201501MN<br>神戸市北区鈴蘭台北町1丁目1-11-103<br>TEL:0120-093-849<br>製造販売：株式会社伊勢半<br>東京都千代田区四番町6番11号<br>TEL：0120-414-793<br>区分：化粧品<br><br><br><font color="#cc0000"> ■ <b>関連商品</b></font><br> <style type="text/css"> <!-- .u1 { list-style-image: url(http://image.rakuten.co.jp/drugpure/cabinet/signboard/list-red.gif);margin: 0 0 0 20px; padding: 0;} --> </style> <ul class="u1"><li>マスカラ　関連商品</li><li>ヒロインメイク　シリーズ</li><li>株式会社伊勢半　お取扱い商品</li></ul><style type="text/css"><!--
